css:
.select-list.popover-list {
  z-index: 2 !important;
}
atom-text-editor atom-color-highlight,
atom-text-editor::shadow atom-color-highlight {
  display: block;
  z-index: 1;
  position: relative;
}
atom-text-editor atom-color-highlight dot-color-marker,
atom-text-editor::shadow atom-color-highlight dot-color-marker {
  display: block;
  position: absolute;
  border-radius: 50%;
  margin-top: 2px;
  z-index: -2;
}
atom-text-editor atom-color-highlight dot-color-marker.selected .selector,
atom-text-editor::shadow atom-color-highlight dot-color-marker.selected .selector {
  position: absolute;
  height: 0;
  width: 0;
  border: 6px solid transparent;
  border-bottom-color: #0088ff;
  left: 50%;
  margin-left: -6px;
  top: 100%;
}
atom-text-editor atom-color-highlight color-marker.selected,
atom-text-editor::shadow atom-color-highlight color-marker.selected {
  display: none;
}
atom-text-editor atom-color-highlight .region,
atom-text-editor::shadow atom-color-highlight .region {
  position: absolute;
  padding: 0px 2px;
  margin-left: -1px;
  display: inline-block;
  line-height: inherit;
  box-sizing: content-box;
  border-radius: 2px;
  z-index: -2;
  white-space: pre;
}
atom-text-editor atom-color-highlight dot-color-marker:before,
atom-text-editor::shadow atom-color-highlight dot-color-marker:before,
atom-text-editor atom-color-highlight .region:before,
atom-text-editor::shadow atom-color-highlight .region:before {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: url(atom://atom-color-highlight/resources/transparent-background.png);
  top: 0;
  left: 0;
  z-index: -1;
  border-radius: inherit;
}
atom-text-editor atom-color-highlight dot-color-marker:after,
atom-text-editor::shadow atom-color-highlight dot-color-marker:after,
atom-text-editor atom-color-highlight .region:after,
atom-text-editor::shadow atom-color-highlight .region:after {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: inherit;
  z-index: -1;
  top: 0;
  left: 0;
  border-radius: inherit;
}
